window.bookSummaryJSON = "<p>Lucifer, the Lord of Hell, has reappeared into my life, and he owes a shit ton of alimony. </p> <p>Twenty-five years worth to be exact, timed from the day he walked out on me and my mother and never looked back. </p> <p>And I plan on making his life a living Hell until he pays up. </p> <p>He just smiles, ruffles my hair, and tells me I'm cute when I'm angry. </p> <p>But anger isn't all that's rising to the surface with this surprise reunion. </p> <p>The seal on my past has been broken, and the skeletons in the closet are coming out to play. </p> <p>Dark secrets that involve my mother and the circumstances surrounding her death. </p> <p>Now I want truth...I demand justice - served cold, on a platter, alongside my father's stony heart. </p> <p>But the past isn't done with me, not by a long shot. </p> <p>It whispers a new name now...mine. </p> <p>And it won't stop until the circle is complete, and I lie in an unmarked grave alongside my mom at the hands of a powerful sect called The Nine. </p> <p>The men I love won't let that happen. </p> <p>Inspector Titus Banks will risk his job. </p> <p>Rival, my Hellhound, will turn his back on the Lord of Hell himself. </p> <p>The Archangel Gabriel will bleed. </p> <p>And they'll do it all for love. </p> <p>I'm holding on with all I have, adrift in the darkness of the past...only I can't hold on much longer. </p> <p>I need my Harem...and I need them now. </p> <p>Contains mature themes.</p>"; 
